<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Bagaimana Pencegahan COVID-19 dengan absensi online? | Akhir-akhir ini pandemi COVID-19 menyerang seluruh dunia. COVID-19 merupakan sebuah virus yang dapat menular melalui </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">droplets</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> atau tetesan air, berasal dari batuk atau bersin dari orang yang terinfeksi. Tingkat penyebarannya sangat cepat hingga saat ini jumlah orang yang terinfeksi mencapai 33,549,873 di seluruh dunia (per 29 Sept 2020).</span> Karena dahsyatnya penyebaran pandemi ini, negara-negara menutup perbatasan mereka untuk mencegah penyebaran COVID-19 dari luar wilayah dan menganjurkan masyarakat untuk mematuhi protokol kesehatan.</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><b id="docs-internal-guid-36058d7b-7fff-b1d0-00db-35530c7b5cc5" style="font-weight: normal;"> </b></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Seperti yang sudah disebutkan sebelumnya, COVID-19 menular lewat </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">droplets</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">, atau tetesan air. Bila tetesan air terkena apapun, virus tersebut bisa bertahan hidup di bidang tersebut hingga berjam-jam. Oleh sebab itu, salah satu protokol kesehatan adalah mengurangi sentuhan pada benda-benda yang berada di tempat umum. Namun apakah hal tersebut dapat berlaku pada mesin absensi?</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><a style="font-family: Tahoma, Helvetica, Arial, sans-serif; font-size: 12.16px; text-align: center; white-space: normal;" title="5 Cara Kerja HRD" href="index.php/blog/article-news/104-hr-dapat-melakukan-wfh-dengan-menggunakan-cloud">Baca juga : Proses Proses HR Dapat diakses dari Rumah</a></span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><b style="font-weight: normal;"> </b></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Mesin absensi membutuhkan biometrik sidik jari, di mana tidak memungkinkan untuk tidak menyentuh mesin absensi tersebut untuk mengabsen dikarenakan sidik jari wajib menyentuh pemindai. Sedangkan, apabila harus menyentuh mesin absensi maka resiko paparan ke virus COVID-19 akan meningkat, dan tidak memungkinkan pula untuk membersihkannya terus menerus jika dalam keadaan orang mengantri untuk absensi karena dapat memperlambat. Atau, mesin absensi bisa cepat rusak apabila terus-menerus disemprot desinfektan. Lantas harus bagaimana?</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> <img style="display: block; margin-left: auto; margin-right: auto;" src="images/blog/Absensi_Online_-_ESS_-HR_Attendance_System_2020.png" alt="Melakukan Absensi Melalui Ponsel Masing-Masing" width="440" height="536" /></span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Solusi yang ditawarkan PT. Realta Chakradarma adalah SIAP</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><span style="font-size: 0.6em; vertical-align: super;">+P</span></span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">, sistem absensi yang memampukan karyawan untuk melakukan absen melalui ponsel mereka masing-masing, tanpa harus menyentuh mesin absensi. Absensinya dilakukan secara online, setelah itu datanya direkam dan disimpan dalam database </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">cloud </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">sehingga mudah didata. Jadi, kantor beroperasi sesuai dengan protokol kesehatan dalam pemutusan rantai penyebaran COVID-19. PT Realta Chakradarma sendiri telah berpengalaman dalam hal absensi selama lebih dari 25 tahun. SIAP</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><span style="font-size: 0.6em; vertical-align: super;">+P</span></span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> telah melayani lebih dari 200 pelanggan di seluruh Indonesia. Selain itu, SIAP+P dapat menghitung Absensi, Payroll, BPJS, dan PPh 21 secara benar dan cepat.</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> </span></p>
